<p>–ú–æ–∂–Ω–∞ –Ω–∞–∑–≤–∞—Ç–∏ —Å–µ–±–µ –¥–æ–±—Ä–∏–º, –∞–ª–µ —Ü–µ –Ω—ñ—á–æ–≥–æ –Ω–µ –≤–∞—Ä—Ç–µ, –ø–æ–∫–∏ —Ç–∞ –¥–æ–±—Ä–æ—Ç–∞ –Ω–µ –ø—Ä–æ—è–≤–∏—Ç—å—Å—è.</p><strong><a id='u4'></a><h2>–ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ –ü—ñ—Å–æ—á–∏–Ω</h2></strong><p>–á–π —Ç–∞–∫–æ–∂ –Ω–µ –ø–æ–¥–æ–±–∞—î—Ç—å—Å—è, –∫–æ–ª–∏ —Ä–µ—á–µ–Ω–Ω—è –ø–æ—á–∏–Ω–∞—î—Ç—å—Å—è —Å–ª–æ–≤–∞–º–∏ "–¥—Ä—É–∑—ñ –∫–∞–∂—É—Ç—å‚Ä¶". –î–æ–≥–µ—Ä—Ç—ñ –≤–≤–∞–∂–∞—î, —â–æ —Ç–∞–∫—ñ –≤–∏—Å–ª–æ–≤–∏ –∑–∞–ø–æ–∑–∏—á—É—é—Ç—å –∑ —Ä–æ–º–∞–Ω—Ç–∏—á–Ω–∏—Ö –∫–æ–º–µ–¥—ñ–π, –∫–Ω–∏–∂–æ–∫ —Ç–∞ –ø—Ä–æ—Ñ—ñ–ª—ñ–≤ —ñ–Ω—à–∏—Ö –∫–æ—Ä–∏—Å—Ç—É–≤–∞—á—ñ–≤: "–Ø –∑–≤–∏—á–∞–π–Ω–∞ —Å–æ–±—ñ –ª—é–¥–∏–Ω–∞", ‚Äî –æ—Å—å —â–æ –≤–∏ –≥–æ–≤–æ—Ä–∏—Ç–µ". –ü–∞–Ω –Ü–Ω“ë–ª–∞–Ω–¥ –≤—ñ–¥–Ω–æ—Å–∏—Ç—å —Ü—é —Ñ—Ä–∞–∑—É –¥–æ –Ω–∞–π–º–µ–Ω—à –∑–º—ñ—Å—Ç–æ–≤–Ω–∏—Ö. –ü–æ–∫–∞–∂—ñ—Ç—å –º–µ–Ω—ñ —Ç–æ–≥–æ, —Ö—Ç–æ –Ω–µ –≤–≤–∞–∂–∞—î –¥—Ä—É–∑—ñ–≤ –≤–∞–∂–ª–∏–≤–∏–º–∏", ‚Äî –∫–∞–∂–µ –≤—ñ–Ω. –ô–æ–≥–æ –≥–æ–ª–æ–≤–Ω–∞ –¥—É–º–∫–∞: –Ω–µ —Ç—Ä–µ–±–∞ –≤—ñ–¥–Ω–æ—Å–∏—Ç–∏ –¥–æ —É–ø–æ–¥–æ–±–∞–Ω—å —Ç–µ, —â–æ –¥—É–∂–µ —Ä—ñ–¥–∫–æ –∫–æ–º—É –Ω–µ –ø–æ–¥–æ–±–∞—î—Ç—å—Å—è.</p>
