<p>–£ —Å–≤–æ—î–º—É –ø–µ—Ä–µ–ª—ñ–∫—É 10 —Ä–µ—á–µ–π, —è–∫—ñ –≤—ñ–Ω –Ω–µ –≤–∏–Ω–æ—Å–∏—Ç—å —É –ø—Ä–æ—Ñ—ñ–ª—è—Ö –∫–æ—Ä–∏—Å—Ç—É–≤–∞—á—ñ–≤ Plenty of Fish, “ê—Ä–µ“ë –ì–µ–Ω–¥—Ä—ñ–∫—Å –ø–∏—à–µ, —â–æ –Ω–∞–≤—ñ—Ç—å —É–≤–∞–≥–∏ –Ω–µ –∑–≤–µ—Ä—Ç–∞—î –Ω–∞ —Ç–∞–∫—ñ –±–∞–Ω–∞–ª—å–Ω—ñ —Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏—Å—Ç–∏–∫–∏. –¶—ñ —Ä–∏—Å–∏ –∑–≥–∞–¥—É—é—Ç—å—Å—è —Ç–∞–∫ —á–∞—Å—Ç–æ, —â–æ –º–æ—ó –æ—á—ñ –ø—Ä–æ—Å—Ç–æ –ø–µ—Ä–µ—Å—Ç–∞–ª–∏ —ó—Ö –ø–æ–º—ñ—á–∞—Ç–∏. –î–æ —Ç–æ–≥–æ –∂, —Ö—Ç–æ —Å–∫–∞–∂–µ —ñ–Ω–∞–∫—à–µ? –†—ñ–∑–Ω–æ–≤–∏–¥: "–õ—é–±–ª—é –∑–≥–æ—Ä–Ω—É—Ç–∏—Å—å –∫–∞–ª–∞—á–∏–∫–æ–º –±—ñ–ª—è –∫–∞–º—ñ–Ω–∞".</p>
